import React, { useEffect } from 'react';
import ProductsList from "./ProductsList"
import PropTypes from 'prop-types';

import commerce from './Commerce';

import { useParams } from "react-router-dom";

const Category = ({ addToCart, removeFromCart, sendToCart, loading }) => {

    let params = useParams();
    useEffect(() => {
        alert(params.categorySlug);
        commerce.categories.retrieve(params.categorySlug, {type: 'slug'}).then(response => alert(JSON.stringify(response)));
        commerce.products.list({category_slug: params.categorySlug}).then(response => alert(JSON.stringify(response)));
    }, []);

    return (
        <div class="d-flex justfiy-content-center content">
            <h5>{}</h5>
            {/* <ProductsList
                products={products}
                addToCart={addToCart}
                removeFromCart={removeFromCart}
                sendToCart={sendToCart}
                loading={loading}
            /> */}
        </div>
    )
}

Category.propTypes = {
    products: PropTypes.array,
    addToCart: PropTypes.func
};

export default Category;
